import React from 'react';
import {BrowserRouter as Router, Route, NavLink, Switch} from 'react-router-dom'
import { CSSTransition, TransitionGroup } from 'react-transition-group';
// import Navbar from 'react-bootstrap/Navbar'
import About from './components/about.js'
import Project from './components/project.js'
import Film from './components/film.js'
import './components/App.css';





function App() {

    return (
    <Router>
      <div className="nav">
        <div className="nav-sub">
          <NavLink to="/project" className="nav-link"> PROJECT</NavLink>
          <NavLink to="/" className="nav-link"> HOME</NavLink>
          <NavLink to="/film" className="nav-link"> FILM</NavLink>
        </div>
        <svg class="MyLineLeft" height="10" width="150">
        <line id="line" x1="150" y1="5" x2="10" y2="5"  />
         </svg>

      </div>
      <Route
        render={({ location }) => {
          const { pathname } = location;
          return (
            <TransitionGroup compononet={null}>
              <CSSTransition timeout={{
                enter: 1000,
                exit: 1000,
              }} classNames="page" key={pathname}
              >
                <Route
                  location={location}
                  render={() => (
                    <Switch>
                      <Route exact path="/" component={About} />
                      <Route path="/film" component={Film} />
                      <Route path="/project" component={Project} />
                    </Switch>
                  )}
                />
              </CSSTransition>
            </TransitionGroup>
          )
        }}
      />
    </Router>
  );
}




export default App;
